import React, {PureComponent} from 'react';

import styles from './style.scss';

export default class AppContainer extends PureComponent {
  constructor(props) {
    super(props);
    this.state = {
      _mAppTextColumnItemObject1: 'none',
      _mAppTextColumnItemObject2: 'none',
      _mAppTextColumnItemObject3: 'none',
      _resizer: 1
    };
    this.random = this.random.bind(this);
  }

  componentDidMount = () => {
    this.random();
  };
  componentDidUpdate = () => {
    this.random();
  };
  random = () => {
    var i = Math.floor(1 + Math.random() * 3);
    console.log(i);
    switch (i) {
      case 1:
        this.setState({
          _mAppTextColumnItemObject1: 'block',
          _mAppTextColumnItemObject2: 'none',
          _mAppTextColumnItemObject3: 'none'
        });
        break;
      case 2:
        this.setState({
          _mAppTextColumnItemObject1: 'none',
          _mAppTextColumnItemObject2: 'block',
          _mAppTextColumnItemObject3: 'none'
        });
        break;
      case 3:
        this.setState({
          _mAppTextColumnItemObject1: 'none',
          _mAppTextColumnItemObject2: 'none',
          _mAppTextColumnItemObject3: 'block'
        });
        break;
      default:
        break;
    }
  };

  render() {
    return (
      <section id={this.props.containerID} className={styles.mAppContainer}>
        <div className={styles.mAppContainerFlex}>
          <div className={styles.mAppTextColumn}>
            {/* <Parallax offsetYMax={0} offsetYMin={100} offsetXMax={0} offsetXMin={0}> */}
            <div className={styles.mAppTextColumnItem}>
              <div
                style={{display: this.state._mAppTextColumnItemObject1}}
                className={styles.mAppTextColumnItemObject1}
              />
              <div
                style={{display: this.state._mAppTextColumnItemObject2}}
                className={styles.mAppTextColumnItemObject2}
              />
              <div
                style={{display: this.state._mAppTextColumnItemObject3}}
                className={styles.mAppTextColumnItemObject3}
              />
              <div className={styles.mAppTextColumnItemWrapper}>
                <header>
                  <h2 className={styles.mAppFirstLine}>{this.props.firstLine}</h2>
                </header>
                <p className={styles.mAppSecondLine}>
                  {this.props.secondLine_1}
                  <br />
                  {this.props.secondLine_2}
                </p>
              </div>
            </div>
            {/* </Parallax> */}
          </div>
          <div className={styles.mAppImgColumn}>
            {/* <Parallax offsetYMax={0} offsetYMin={0} offsetXMax={-20} offsetXMin={30}> */}
            <div className={styles.mAppImgColumnWrapper}>
              {/* <img
                  className={styles.mAppImg}
                  src="http://178.128.174.121/images/wo.web.images/app_iphone.png"
                  alt=""
                /> */}
              <img
                className={styles.mAppImg}
                src="data:image/png;base64,"
                alt=""
              />
              {/* <video className="m-app-img-video" playsinline='' autoplay='' loop=''>
                                <source src="https://player.vimeo.com/external/251237695.hd.mp4?s=d977df4841cc6a9d20df8bb3bfa0ee561127abec&profile_id=175" type="video/mp4"></source>
                            </video> */}
            </div>
            {/* </Parallax> */}
          </div>
        </div>
      </section>
    );
  }
}
